import React from 'react';
import Presentation from './components/presentation'
import { Header, Container } from 'semantic-ui-react'
import './App.css';

function App() {
  return (
    <div>
      <br />
      <Container>
        <Header as='h1' textAlign='center'>Renseigner les informations d'un futur collaborateur</Header>
        <p textAlign='center'>Vous allez renjoindre le groupe Doctegestio, pour préparer au mieu votre intégration merci de renseigner le formulaire ci-dessous.</p>
        <Presentation />
      </Container>
    </div>
  );
}

export default App;
